import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './views/Home'
import About from './views/About';
import Projects from './views/Projects';
import Arlis from './views/Arlis';
import Experience from './views/Experience';
import './App.css';

function App() {
  const [showMenu, setShowMenu] = useState(false);

  return (
    <Router>
      <div>
        {/* Menu button */}
        <button onClick={() => setShowMenu(!showMenu)}>Menu</button>

        {/* Conditional rendering of navigation items */}
        {showMenu && (
          <div className="menu">
            <Link to="/about" onClick={() => setShowMenu(false)}>About</Link>
            <Link to="/projects" onClick={() => setShowMenu(false)}>Projects</Link>
            <Link to="/arlis" onClick={() => setShowMenu(false)}>Arlis</Link>
            <Link to="/experience" onClick={() => setShowMenu(false)}>Experience</Link>
          </div>
        )}

        {/* Route Definitions */}
        <Routes>
          <Route path="/about" element={<About />} />
          <Route path="/projects" element={<Projects />} />
          <Route path="/arlis" element={<Arlis />} />
          <Route path="/experience" element={<Experience />} />
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
